import React, { useState, useEffect } from 'react'

const UsersListing = () => {
    const [data, setData] = useState(null);

    useEffect( ()=> {
        fetch('https://dummyjson.com/users').then((result)=>{
            result.json().then(res => {
                setData(res.users)
            })
        })
    }, [])

  return (
    <div>
      <h1>User Listing</h1>
      {data?.map((val, index) => {
        <h2 key={val.id}>{val.firstName}</h2>
      })}
    </div>
  )
}

export default UsersListing
